   "source": [
    "# Calculate hourly steps\n",
    "hourly_steps <- hourly_steps %>%\n",
    "  separate(date_time, into = c(\"date\", \"time\"), sep= \" \") %>%\n",
    "  mutate(date = ymd(date)) \n",
    "  \n",
    "head(hourly_steps)"
   ]
